  uneFormationEstUn: /*#__PURE__*/_react.default.createElement(_react.default.Fragment, null, "Comme la formation \xE0 distance, la formation en ligne est le fait de se former via des plateformes d\xE9di\xE9es sur internet. Vous trouverez des formations dipl\xF4mantes, certifiantes ou simplement pour votre culture. C\u2019est notamment le cas des MOOCs (Massive Online Open Courses) qui permettent \xE0 tout le monde de suivre de petites formations en ligne et de gagner en comp\xE9tences ou en culture personnelle. Ce mode de formation permet de gagner du temps et de suivre la formation lorsque l\u2019on peut et veut se connecter. En ligne, vous pourrez aussi trouver des formations de haut niveau et dipl\xF4mantes comme des bachelors ou des CAP par exemple. Seul inconv\xE9nient, vous devrez vous exercer seul, car la pratique est exclue des cours en ligne.", /*#__PURE__*/_react.default.createElement("br", null), /*#__PURE__*/_react.default.createElement("br", null), "Les formations en ligne sont souvent utilis\xE9es en entreprise lorsque les managers veulent faire \xE9voluer des employ\xE9s en leur demandant d\u2019apprendre de nouvelles notions."),
